import React, { Component } from 'react'

export class homePage extends Component {
    render() {
        return (
            <div>
                <div className="home">
                    <h2>Andrew Zajac</h2>
                    <p>Software Engineer</p>
                </div>
            </div>
        )
    }
}

export default homePage
